DROP TABLE IF EXISTS `reservations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reservations` (
  `reservation_id` int NOT NULL AUTO_INCREMENT,
  `reservation_date` date NOT NULL,
  `check_in_date` date NOT NULL,
  `check_out_date` date NOT NULL,
  `reservation_status` enum('pending','confirmed','checked_in','checked_out','cancelled') NOT NULL DEFAULT 'pending',
  `guest_id` int DEFAULT NULL,
  `host_id` int DEFAULT NULL,
  `billed_party_id` int NOT NULL,
  `advance_deposit_required` tinyint(1) DEFAULT '0',
  `deposit_amount` decimal(10,2) DEFAULT NULL,
  `special_requests` text,
  PRIMARY KEY (`reservation_id`),
  KEY `guest_id` (`guest_id`),
  KEY `host_id` (`host_id`),
  KEY `billed_party_id` (`billed_party_id`),
  CONSTRAINT `reservations_ibfk_1` FOREIGN KEY (`guest_id`) REFERENCES `guests` (`guest_id`) ON DELETE SET NULL,
  CONSTRAINT `reservations_ibfk_2` FOREIGN KEY (`host_id`) REFERENCES `hosts` (`host_id`) ON DELETE SET NULL,
  CONSTRAINT `reservations_ibfk_3` FOREIGN KEY (`billed_party_id`) REFERENCES `billedparties` (`billed_party_id`) ON DELETE CASCADE,
  CONSTRAINT `reservations_chk_1` CHECK ((`check_in_date` < `check_out_date`))
) ENGINE=InnoDB AUTO_INCREMENT=2866 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
